def crptall(file_generator):
    threads = []
    for file in file_generator:
        thread = threading.Thread(target=crypt_file, args=(file,))
        thread.start()
        threads.append(thread)

    # Wait for all threads to finish before exiting
    for thread in threads:
        thread.join()


